import React from 'react';
import logo from './logo.svg';
import './App.css';
import CamposCadastro from './CamposCadastro.js'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p className="row justify-content-right">
          Api UI
        </p>
        <CamposCadastro></CamposCadastro>
      </header>
    </div>
  );
}
'use strict'


class Friends extends React.Component {
    render() {
        return (
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Since</th>
                    </tr>
                </thead>
                <tbody>
                    {this.props.friends && this.props.friends.map(friend => {
                        return <tr>
                            <td>{friend._id}</td>
                            <td>{friend.name}</td>
                            <td>{friend.since}</td>
                        </tr>
                    })}
                </tbody>
            </table>
        );
    }
}

// App component

export default App;
